events_173:
  id: 252
  name: 'DMC : Stick & Puck'
  organization_id: 16
  location_id: 77
  comments: "Maximum 30 skaters on the ice\r\nStudent or Government Issued Photo ID
    is required for pinny rental\r\nFull gear is recommended for all participants\r\nAll
    participants under 16 years of age must be accompanied by an adult\r\nFull gear
    is required for participants under 16 years old\r\nPucks available for purchase
    from the proshop (or bring your own)\r\nAnyone perceived to be under the influence
    of drugs or alcohol will be refused entry\r\nGoalies, games and scrimmages are
    not permitted during the session"
  created_at: '2014-12-15 00:20:34.597087'
  updated_at: '2014-12-15 00:20:34.597087'
events_174:
  id: 253
  name: 'DMC : Family Hockey'
  organization_id: 16
  location_id: 77
  comments: "Family Hockey is a fun way for parents and kids to play together in a
    safe, toned down atmosphere! Helmets are required for all participants and all
    adults must be accompanied by a child. It is recommended that all youth wear full
    gear for their own safety. As this is a program geared towards children and youth
    no slap shots or hard wrist shots are permitted during the session.\r\n\r\nStudent
    or Government Issued Photo ID is required for pinny rental\r\nAnyone perceived
    to be under the influence of drugs or alcohol will be refused entry\r\nPucks available
    for purchase from the proshop (or bring your own)"
  created_at: '2014-12-15 00:22:50.293487'
  updated_at: '2014-12-15 00:22:50.293487'
events_175:
  id: 254
  name: 'DMC : Stick & Puck'
  organization_id: 16
  location_id: 77
  comments: "New to the game? Know the game, but looking to brush up those skills?
    Just wanting to get on the ice in a non-game or non-competitive environment? Stick
    & Puck is the answer to all of the above and a great way to get on the ice any
    time throughout the year. You don't even need all the gear! Space is limited &
    session rules do apply.\r\n\r\nMaximum 30 skaters on the ice\r\nStudent or Government
    Issued Photo ID is required for pinny rental\r\nFull gear is recommended for all
    participants\r\nAll participants under 16 years of age must be accompanied by
